import { sql } from "@vercel/postgres";

export default async function User() {
  const { rows } = await sql`SELECT * from users`;

  return (
    <div>
      {rows.map((row) => (
        <div key={row.user_id}>
          {row.first_name} {row.mid_name} {row.last_name} - {row.email}
        </div>
      ))}
    </div>
  );
}
